import React, { Component } from 'react';

class ButtonChange extends Component {

  render() {
    return <button
      onClick={ this.props.changeTypePokemon } 
      value={ this.props.type } 
      key={ this.props.name }>
        { this.props.type }
      </button>
  }
}

export default ButtonChange;
